if mibBuilder.loadTexts: cadDQoSAuthFlowSpecBucketDepthb.setDescription("Parameter 'b' in TSpec leaky bucket description. The token bucket size controls the maximum amount of data that the flow can send at the peak rate. More formally, if the token bucket size is 'b' and the token bucket rate is 'r', over any arbitrarily chosen interval T in the life of the flow, the amount of data that the flow sends cannot have exceeded b + (r * T) bytes. The bucket size limits how many credits the flow may store. When the bucket is full, new credits are discarded.")
cadDQoSAuthFlowSpecBucketRater = MibTableColumn((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 3, 1, 3), Unsigned32()).setUnits('bits per second').setMaxAccess("readwrite")
if mibBuilder.loadTexts: cadDQoSAuthFlowSpecBucketRater.setStatus('current')
if mibBuilder.loadTexts: cadDQoSAuthFlowSpecBucketRater.setDescription("Parameter 'r' in TSpec leaky bucket description. The token bucket rate is the rate at which credits are placed into an imaginary token bucket. For each flow, a separate bucket is maintained. To send a packet over the flow, a host must remove a number of credits equal to the size of the packet from the token bucket. If there are not enough credits, the host must wait until enough credits accumulate in the bucket.")
cadDQoSAuthFlowSpecPeakRatep = MibTableColumn((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 3, 1, 4), Unsigned32()).setUnits('bits per second').setMaxAccess("readwrite")
if mibBuilder.loadTexts: cadDQoSAuthFlowSpecPeakRatep.setStatus('current')
if mibBuilder.loadTexts: cadDQoSAuthFlowSpecPeakRatep.setDescription("Parameter 'p' in TSpec leaky bucket description. The maximum transmission rate limits how fast packets may be sent back to back from the host. Consider that if the token bucket is full, it is possible for the flow to send a series of back-to-back packets equal to the size of the token bucket. At all times, 'p' MUST be greater than or equal to the token bucket rate, 'r'.")
cadDQoSAuthFlowSpecMinPolicedUnitm = MibTableColumn((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 3, 1, 5), Unsigned32()).setUnits('octets').setMaxAccess("readwrite")
