if mibBuilder.loadTexts: cadDQoSAuthFlowSpecMinPolicedUnitm.setDescription("Parameter 'm' in TSpec leaky bucket description. All IP datagrams less than size 'm' will be counted, when policed and tested for conformance to the TSpec, as being of size 'm'. This is the smallest size packet that the source will generate.")
cadDQoSAuthFlowSpecMaxPktSizeM = MibTableColumn((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 3, 1, 6), Unsigned32()).setUnits('octets').setMaxAccess("readwrite")
