cadDQoSTimerT0 = MibScalar((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 4), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 60)).clone(30)).setUnits('seconds').setMaxAccess("readwrite")
if mibBuilder.loadTexts: cadDQoSTimerT0.setStatus('current')
if mibBuilder.loadTexts: cadDQoSTimerT0.setDescription('This timer is implemented in the CMTS in the Gate state machine, and limits the period of time that a gate may be allocated without the gate parameters being set. This enables the CMTS to recover the gate-ID resources when the Call Management System fails to complete the signaling sequence for a new session. The default value of this timer is 30 seconds. This timer has a range of 1 to 60 seconds.')
cadDQoSTimerT1 = MibScalar((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 5), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 600)).clone(250)).setUnits('seconds').setMaxAccess("readwrite")
if mibBuilder.loadTexts: cadDQoSTimerT1.setStatus('current')
if mibBuilder.loadTexts: cadDQoSTimerT1.setDescription('This timer is implemented in the CMTS in the Gate state machine, and limits the period of time that may elapse between the authorization and a commit is performed. This timer is started whenever a Gate is established. This timer is reset whenever a Commit operation is performed on the resources authorized by the gate. Timer-T1 MUST be set to the value given in the GATE-SET message. If the value given in the GATE-SET message is zero, then Timer-T1 MUST be set to a provisionable default value. The default value of this timer is 250 seconds.')
cadDQoSTimerT2 = MibScalar((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 6), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 60)).clone(2)).setUnits('seconds').setMaxAccess("readwrite")
if mibBuilder.loadTexts: cadDQoSTimerT2.setStatus('current')
if mibBuilder.loadTexts: cadDQoSTimerT2.setDescription('This timer is implemented in the CMTS in the Gate state machine, and limits the time in the transient states of gate coordination. This timer is long enough to accommodate loss and retransmission of Gate coordination messages, but is short enough to not allow significant theft of service. Timer-T2 MUST be set to the value given in the GATE-SET message. If the value given in the GATE-SET message is zero, then Timer-T2 MUST be set to a provisionable default value. The default value of this default is 2 seconds.')
cadDQoSTimerT3 = MibScalar((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 7), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(5, 50)).clone(40)).setUnits('tenths of a second').setMaxAccess("readwrite")
if mibBuilder.loadTexts: cadDQoSTimerT3.setStatus('current')
if mibBuilder.loadTexts: cadDQoSTimerT3.setDescription('This timer is implemented in the MTA or CMTS in the handling of RSVP reservations. It controls the total time that can elapse before the RSVP retransmit process gives up without receiving an acknowledgement in the presence of network loss. It is short enough to recover quickly from lost messages and not significantly impact the post-dial delay, but is long enough to allow the CMTS to acknowledge the request and all intermediate routers in the customer network. The default value of this timer is 4 seconds.')
cadDQoSTimerT4 = MibScalar((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 8), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 10)).clone(5)).setUnits('tenths of a second').setMaxAccess("readwrite")
if mibBuilder.loadTexts: cadDQoSTimerT4.setStatus('current')
if mibBuilder.loadTexts: cadDQoSTimerT4.setDescription('This timer is implemented in the MTA in the handling of COMMIT messages. It controls the retransmission of COMMIT messages that may have been lost by the network. It is short enough to recover quickly from lost commit requests and not significantly impact the post-pickup delay, but is long enough to allow processing of the COMMIT request at the CMTS. The default value of this timer is 500ms.')
cadDQoSTimerT5 = MibScalar((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 9), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 10)).clone(5)).setUnits('tenths of a second').setMaxAccess("readwrite")
if mibBuilder.loadTexts: cadDQoSTimerT5.setStatus('current')
if mibBuilder.loadTexts: cadDQoSTimerT5.setDescription('This timer is implemented in the CMTS (and CMTS-proxy) in the gate coordination processing. It controls the retransmission of GATE-OPEN and GATE-CLOSE messages that may have been lost by the network. It is short enough to recover quickly from lost gate coordination messages, but long enough to allow processing of the gate coordination message at the CMTS or CMTS-proxy. This timer interacts in the case of GATE-OPEN with Timer-T2, and SHOULD be significantly smaller than Timer-T2. The default value of this timer is 500ms.')
cadDQoSTimerT6 = MibScalar((1, 3, 6, 1, 4, 1, 4998, 1, 1, 115, 1, 2, 1, 1, 10), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 10)).clone(5)).setUnits('tenths of a second').setMaxAccess("readwrite")
